import { Card } from 'flowbite-react';
import React from 'react';
import "./style.scss";

const PostItem = (props) => {
    return (
        <div className="post-item bg-white rounded-md border shadow-md dark:bg-gray-800 dark:border-gray-700 flex items-center flex-col items-stretch">
            <img  className="rounded-md h-48 object-cover" src={props.imgSource} alt="nhà trọ" />
            <h2 className="font-bold line-clamp-2 text-left p-5"> Full nội thất cao cấp, Thang máy, Bếp, 24m2, Mới 99%, KM 15% giá thuê </h2>
            <h2>6.5 triệu</h2>
        </div>
    );
};

export default PostItem;
